import React from "react";
import { useParams } from "react-router-dom";

interface Post {
  id: string;
  title: string;
  content: string;
  author: string;
  date: string;
  category: string;
}

interface Comment {
  postId: string;
  author: string;
  text: string;
}

const posts: Post[] = [
  { id: "1", title: "Welcome to the Blog", content: "This is your first post! **Enjoy blogging!** Here you can share your thoughts, stories, and ideas with the world.", author: "Admin", date: "2024-06-23", category: "General" },
  { id: "2", title: "React 19 Features", content: "React 19 introduces new hooks, improved performance, and better developer experience. _Stay tuned for more details!_", author: "Jane", date: "2024-06-22", category: "Tech" },
  { id: "3", title: "How to Write Great Blog Posts", content: "Writing engaging content is an art. Start with a catchy title, use clear language, and always provide value to your readers.", author: "Alex", date: "2024-06-21", category: "Writing" },
  { id: "4", title: "Understanding TypeScript", content: "TypeScript helps you write safer and more maintainable React code. Learn about types, interfaces, and generics!", author: "Sam", date: "2024-06-20", category: "Tech" },
  { id: "5", title: "Traveling the World", content: "Being a digital nomad lets you explore new cultures while working remotely. Here are some tips for your next adventure.", author: "Chris", date: "2024-06-19", category: "Travel" },
  { id: "6", title: "Healthy Habits for Developers", content: "Take breaks, stretch, and stay hydrated. Your body and mind will thank you for it!", author: "Morgan", date: "2024-06-18", category: "Lifestyle" },
  { id: "7", title: "The Future of AI", content: "AI is transforming industries and daily life. What does the future hold? Let's discuss the possibilities.", author: "Taylor", date: "2024-06-17", category: "Tech" },
  { id: "8", title: "Minimalist Living", content: "Minimalism is about focusing on what matters. Declutter your space and your mind for a happier life.", author: "Jordan", date: "2024-06-16", category: "Lifestyle" },
];

const comments: Comment[] = [
  { postId: "1", author: "Jane", text: "Great start!" },
  { postId: "1", author: "John", text: "Looking forward to more posts." },
  { postId: "2", author: "Alex", text: "Excited for React 19!" },
  { postId: "3", author: "Sam", text: "Very helpful tips." },
  { postId: "4", author: "Chris", text: "TypeScript makes everything better." },
  { postId: "5", author: "Morgan", text: "Traveling is the best way to learn." },
  { postId: "6", author: "Taylor", text: "Health is wealth!" },
  { postId: "7", author: "Jordan", text: "AI is the future." },
  { postId: "8", author: "Admin", text: "Love this minimalist approach." },
];

const Post: React.FC = () => {
  const { id } = useParams<{ id: string }>();
  const post = posts.find(p => p.id === id);
  const postComments = comments.filter(c => c.postId === id);

  if (!post) return <div style={{padding: '2em', textAlign: 'center', color: '#e53e3e'}}>Post not found.</div>;

  return (
    <div>
      <h1>{post.title}</h1>
      <div style={{ marginBottom: "1em", color: "#555" }}>
        <strong>Author:</strong> {post.author} | <strong>Date:</strong> {post.date} | <strong>Category:</strong> {post.category}
      </div>
      <div style={{ marginBottom: "1em", background: "#f9f9f9", padding: "0.5em 1em", borderRadius: "6px" }}>
        <strong>About the author:</strong> <span style={{ color: "#888" }}>[Profile coming soon]</span>
      </div>
      <div style={{ margin: "1em 0" }}>{post.content}</div>
      <button disabled style={{ marginBottom: "1em", opacity: 0.5 }}>👍 Like (0)</button>
      <h2>Comments</h2>
      <ul>
        {postComments.map((c, i) => (
          <li key={i}><strong>{c.author}:</strong> {c.text}</li>
        ))}
      </ul>
      <div style={{ marginTop: "1em" }}>
        <input type="text" placeholder="Add a comment..." style={{ width: "60%", marginRight: "0.5em" }} disabled />
        <button disabled style={{ opacity: 0.5 }}>Post</button>
      </div>
    </div>
  );
};

export default Post;
